const SensorData = {
    FOV: 45, 
    Zoom: 2, 
    PanAngle: 20, 
    TiltAngle: 30
}

const Registration = {
    RobotID: 1, 
    SensorType: "EO", 
    XYFloor: [1,2,3], 
    Sensor: ["EO", "Lidar"]
}

const sensorNet = {
    SensorTelemetry: {
        SensorID: 12344321, 
        SensorType: "EO", 
        },

    SensorData,
    Registration
}

export default sensorNet;
